    def runing(self):
        import test_gui_web as ts_gui
        import os
        import subprocess as sp

        client_ip = str(self.cip.text()).replace(")","").replace("(","")
        client_port = str(self.cport.text()).replace(")","").replace("(","")
        server_ip = str(self.sip.text()).replace(")","").replace("(","")
        server_port = str(self.sport.text()).replace(")","").replace("(","")
        Network_Indicator = str(self.netindicator.text()).replace(")","").replace("(","")


        Targer_MSISDN = str(self.msisdn.text()).replace(")","").replace("(","")

        locael_MSC = str(self.locaelmsc.text()).replace(")","").replace("(","")

        Targer_IMSI = str(self.imsi.text()).replace(")","").replace("(","")
        if(len(Targer_IMSI) < 15 or len(Targer_IMSI) > 16):
            from PyQt5.QtWidgets import  QPushButton, QMessageBox
            msgBox = QMessageBox()
            msgBox.setIcon(QMessageBox.Information)
            msgBox.setText("IMSI len should be 15 or 16")
            msgBox.setWindowTitle("IMSI Error")
            msgBox.setStandardButtons(QMessageBox.Ok | QMessageBox.Cancel)
            returnValue = msgBox.exec()
            exit(0)

        user_i_mcc = str(self.mcc.text()).replace(")","").replace("(","")
        user_i_mnc = str(self.mnc.text()).replace(")","").replace("(","")
        user_i_LAC2 = str(self.lac2.text()).replace(")","").replace("(","")
        user_i_CI = str(self.ci.text()).replace(")","").replace("(","")
        user_i_Lat = str(self.lat.text()).replace(")","").replace("(","")
        user_i_Uncertain = str(self.uncertain.text()).replace(")","").replace("(","")
        user_i_Long2 = str(self.long2.text()).replace(")","").replace("(","")


        

        ts_gui.simulator_tracking_SendRoutingInfo(client_ip,client_port,server_ip,server_port,Network_Indicator,Targer_MSISDN,locael_MSC,Targer_IMSI,user_i_mcc,user_i_mnc,user_i_LAC2,user_i_CI,user_i_Lat,user_i_Uncertain,user_i_Long2)
        data = open('outingss7.txt','r').read().replace('[0m',' \n ').replace('\x1b[31m',' \n ').replace('\x1b[32m',' \n ').replace('\x1b',' \n ').replace('[34m',' ')
        self.output.append(str(data))


